    def minWindow(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: str
        """

        if len(s) < len(t):
            return ""

        if len(s) == len(t):
            return s if s == t else ""

        t_dict = {}
        for c in t:
            if c not in t_dict:
                t_dict[c] = 1
            else:
                t_dict[c] += 1

        s_dict = {}
        for c in s:
            if c not in s_dict:
                s_dict[c] = 1
            else:
                s_dict[c] += 1

        if t_dict == s_dict:
            return s

        start = 0
        end = 0
        min_len = len(s)
        min_start = 0
        min_end = 0
        while end < len(s):
            if s[end] in t_dict:
                if s_dict[s[end]] > t_dict[s[end]]:
                    s_dict[s[end]] -= 1
                else:
                    s_dict[s[end]] -= 1
                    start += 1
            end += 1

        while start < len(s):
            if s[start] in t_dict:
                if s_dict[s[start]] < t_dict[s[start]]:
                    s_dict[s[start]] += 1
                else:
                    s_dict[s[start]] += 1
                    if end - start < min_len:
                        min_len = end - start
                        min_start = start
                        min_end = end
                    start += 1
            start += 1

        return s[min_start:min_end+1]

