    def longestPalindrome(self, s):
        """
        :type s: str
        :rtype: int
        """

        # create a dictionary to store the frequency of each character in the string
        freq = {}

        # loop through the string and add each character to the dictionary
        for char in s:
            if char not in freq:
                freq[char] = 1
            else:
                freq[char] += 1

        # create a variable to store the length of the longest palindrome
        longest_palindrome = 0

        # loop through the dictionary and check if the frequency is greater than 1
