    def uniquePaths(self, m, n):
        """
        :type m: int
        :type n: int
        :rtype: int
        """

        # create a 2D array of size m*n
        grid = [[0 for x in range(n)] for y in range(m)]

        # fill the first row with 1s
        for i in range(m):
            grid[i][0] = 1

        # fill the first column with 1s
        for j in range(n):
            grid[0][j] = 1

        # fill the rest of the grid
